package com.frysning.springdnd.speed;import com.frysning.springdnd.speedtype.SpeedType;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.JoinColumn;import javax.persistence.ManyToOne;@Entitypublic class Speed {    private @Id    @GeneratedValue(strategy = GenerationType.IDENTITY) Long id;    @ManyToOne    @JoinColumn(name = "speedtype_id", referencedColumnName = "id", nullable = false)    private SpeedType speedType;    private int range;    public Speed(Long id, SpeedType speedType, int range) {        this.id = id;        this.speedType = speedType;        this.range = range;    }    public Speed() {    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getSpeedType() {        return speedType.getName();    }    public void setSpeedType(SpeedType speedType) {        this.speedType = speedType;    }    public int getRange() {        return range;    }    public void setRange(int range) {        this.range = range;    }}